// Definition of the node color based on their position in paths
var dico_colors = {
    "start": '#468966',
    "intermediate": '#5e5c64',
    "end": '#c01c28'
}


function url_cluster(icone, color, number) {
    var number_string = (number).toLocaleString('fr-FR');
    var number_digit = number_string.length;
    if (number_digit > 3) {
        width_start = 14
    }
    else {
        width_start = 16
    }
    return "data:image/svg+xml;charset=utf-8," + encodeURIComponent(dico_icon[icone].split('</svg>')[0].concat(`<rect x="60" y="60" rx="2" ry="2" width="${width_start + (number_digit - 1) * 8}" height="18" fill="red"/><text x="64" y="74" font-size="15" font-weight="bold" font-family="Arial, Helvetica, sans-serif" fill="white">${number_string}</text>`).concat('</svg>'))
}

function get_image(node_attributes_string) {
    // This function generates an icon based on the previously defined SVGs
    var attributes_list = node_attributes_string.split('_');
    var icon_name = attributes_list.shift();
    var position = attributes_list.shift();
    var color = dico_colors[position];

    var icon = '<svg '.concat(` fill="${color}" `).concat(dico_icon[icon_name].split('<svg')[1]);

    icon = icon.split("</svg>")[0];
    for (var i = 0; i < attributes_list.length; i++) {
        icon = icon.concat(dico_attribute[attributes_list[i]]);
    }
    icon = icon.concat("</svg>");
    icon = "data:image/svg+xml;charset=utf-8,".concat(encodeURIComponent(icon));
    return icon;
}
